import React from 'react';
import { FaSearch, FaLink, FaTrash, FaExpandArrowsAlt, FaMousePointer } from 'react-icons/fa';

const ToolBar = () => {
  return (
    <div className="tool-bar">
      <FaSearch className="tool-icon" />
      <FaLink className="tool-icon" />
      <FaTrash className="tool-icon" />
      <FaExpandArrowsAlt className="tool-icon" />
      <FaMousePointer className="tool-icon" />
    </div>
  );
};

export default ToolBar;
